import "./Favorites.css";
import NavbarList from "./NavbarList";
import NavbarProduct from "./NavbarProduct";
import List from "./List";
import ListProdukt from "./ListProdukt";

function Favorites() {
    return(
        <div className="favorites">
            <NavbarList></NavbarList>
            <hr className="line"/>
            <div className="favorites__lists mydiv">
            <ListProdukt/>
            <ListProdukt/>
            <ListProdukt/>
            <ListProdukt/>
            <ListProdukt/>
            <ListProdukt/>

            </div>
        </div>
    )
}

export default Favorites;
